import React, { Component } from 'react'
import {url} from '../../config'
import Default from '../pages/Default'
import Table from '../table'

export default class SubjectList extends Component {
    state ={
        data:[],
    }
    componentDidMount(){
        const data = this.props.location.state;
        fetch(url + `subject/${data.name}`)
        .then(res=>{
            return res.json();
        })
        .then(json=>{
            this.setState({
                data:json,
                className:data.name
            })
            return json;
        })
        .catch(err=>{
            console.log(err);
        })
    }
    render() {
        const {className} = this.state;     
        return (
            this.state.data.length === 0 ? <Default/> : 
            <div>
                <h4>Class: {className}</h4>
                <h4>SubjectList</h4>
                <Table header = {Object.getOwnPropertyNames(this.state.data[0])} data = {data}  onClickRow={(index)=>{
                     this.props.onClickRow(this.state.data[index]);
                 }}/>
                {
                    /*
                 data.map((val, index)=>{
                     return <li key={index}>{val.name}</li>
                 })   
                 */
                }
            </div>
        )
    }
}
